def encontrar_diferencias(lista1, lista2):
    # Verificar que las listas tengan la misma longitud
    if len(lista1) != len(lista2):
        raise ValueError("Las listas deben tener la misma longitud.")

    # Encontrar las posiciones en las que los elementos no coinciden
    diferencias = [i for i in range(len(lista1)) if lista1[i] != lista2[i]]

    return diferencias


